import type React from "react"
import { useState } from "react"
import { MapPin, PawPrint, Search } from "lucide-react"
import { Button } from "./ui/button"
import { Card, CardContent } from "./ui/card"
import { Input } from "./ui/input"

const MapComponent = () => (
    <div className="bg-gray-200 w-full h-[600px] rounded-lg flex items-center justify-center">
        <MapPin className="w-16 h-16 text-gray-400" />
        <span className="sr-only">Map showing pet locations</span>
    </div>
)

const PetCard = ({ pet }) => (
    <Card className="overflow-hidden">
        <img src={pet.image || "/placeholder.svg"} alt={pet.name} className="w-full h-48 object-cover" />
        <CardContent className="p-4">
            <h3 className="text-lg font-semibold">{pet.name}</h3>
            <div className="text-sm text-gray-600">
                <p>
                    {pet.type} • {pet.age} • {pet.size}
                </p>
            </div>
        </CardContent>
    </Card>
)

// Hypothetical semantic search function
const semanticSearch = async (query: string) => {
    // In a real implementation, this would call an API endpoint
    // that processes the query using NLP techniques
    console.log("Performing semantic search for:", query)
    // Simulating an API call
    await new Promise((resolve) => setTimeout(resolve, 1000))
    // Return mock results
    return [
        { id: 1, name: "Buddy", type: "Dog", age: "Young", size: "Medium", image: "/placeholder.svg?height=100&width=100" },
        {
            id: 2,
            name: "Whiskers",
            type: "Cat",
            age: "Adult",
            size: "Small",
            image: "/placeholder.svg?height=100&width=100",
        },
    ]
}

const AdoptionPage = () => {
    const [searchQuery, setSearchQuery] = useState("")
    const [pets, setPets] = useState([])
    const [isLoading, setIsLoading] = useState(false)

    const handleSearch = async (e: React.FormEvent) => {
        e.preventDefault()
        setIsLoading(true)
        try {
            const results = await semanticSearch(searchQuery)
            setPets(results)
        } catch (error) {
            console.error("Error performing search:", error)
        } finally {
            setIsLoading(false)
        }
    }

    return (
        <div className="container mx-auto px-4 py-8">
            <header>
                <a href="/" className="flex items-center gap-2">
                    <PawPrint className="h-6 w-6 text-green-600" />
                    <span className="text-xl font-bold">PetPal Adoptions</span>
                </a>
            </header>
            <h1 className="text-3xl font-bold mb-6 text-center">Find Your Perfect Pet</h1>

            <div className="grid grid-cols-1 lg:grid-cols-3 gap-8">
                <div className="lg:col-span-1">
                    <Card>
                        <CardContent className="p-6">
                            <h2 className="text-xl font-semibold mb-4">Search Pets</h2>
                            <form onSubmit={handleSearch}>
                                <div className="grid gap-4">
                                    <div>
                                        <label htmlFor="searchQuery" className="block text-sm font-medium text-gray-700 mb-1">
                                            Describe your ideal pet
                                        </label>
                                        <Input
                                            id="searchQuery"
                                            value={searchQuery}
                                            onChange={(e) => setSearchQuery(e.target.value)}
                                            placeholder="E.g., friendly dog good with kids"
                                        />
                                    </div>
                                    <Button type="submit" disabled={isLoading}>
                                        <Search className="w-4 h-4 mr-2" />
                                        {isLoading ? "Searching..." : "Search"}
                                    </Button>
                                </div>
                            </form>
                        </CardContent>
                    </Card>
                </div>

                <div className="lg:col-span-2">
                    <MapComponent />

                    <div className="grid grid-cols-1 sm:grid-cols-2 gap-6 mt-8">
                        {pets.map((pet) => (
                            <PetCard key={pet.id} pet={pet} />
                        ))}
                    </div>
                    {pets.length === 0 && !isLoading && (
                        <p className="text-center mt-8 text-gray-600">No pets found. Try a different search query.</p>
                    )}
                </div>
            </div>
        </div>
    )
}

export default AdoptionPage
